import { Route, Router, Routes } from "react-router-dom";
import Ecdata from "./Ecdata";


function Ecrout(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/ecdata" element={<Ecdata/>}/>
                </Routes>
            </Router>
        </div>
    )
}
export default Ecrout;
